// stos dla wąktu który haltuje procesor
unsigned int idle_stack[1024];

// Uwagi godne do zastanowienia się nad:
// [thread]			Uwzględznić możliwość syscalla z wątku kernela (potrzebny do yeldnięcia spawnera?)
// [thread]			Jak będzą semafory, to spawner powinien być wybudzany wtedy kiedy będzie potrzeba stworzenia nowego wątku
// [thread]			zmień pid na signed inta
// [thread]			wątek idle nie powinien być wywoływany jeżeli kolejka wątków nie jest pusta
// [thread]			zapisywanie eflags przy przełączaniu wątków
// [thread] 		zrób listę wszystkich wątków
// []				rozszerzanie stosu i sterty programu
// [thread]			obsłużyć przypadek w którym spawner próbuje stworzyć wątek dla funkcji create_thread, ale rodzic został zakończony

void kernel_main(
	unsigned int kernel_start,
	unsigned int kernel_end,
	multiboot_info_t *mbi, 
	unsigned int magic ){

	do_switching = 0;

	serial_init(); 
	framebuffer_init();
	gdt_entry *gdt_entries = init_gdt();
	init_idt();

	multiboot_memory_map *mem_map = (multiboot_memory_map *)mbi->mmap_addr;
	unsigned int mem_map_size = mbi->mmap_length;

	initialize_memory(kernel_start, kernel_end, mem_map, mem_map_size);

	// ustawianie wskaźników do programów, które będzie można uruchomić spawnerem
	set_progs(3, test_prog, dying, dying_with_threads);

	printf("Kernel directory: %x\n", kernel_directory_struct.directory_addr);

	unsigned int th_error = 0;
	thread_t *t, *t1;
	th_error = 0;

	t1 = thread_setup((elf_header *)test_prog, -1, &th_error);
	// t = thread_setup((elf_header *)dying_with_threads, -1, &th_error);


	// tworzenie wątku bezczynności
	thread_t *idle = (thread_t *)kmalloc(sizeof(thread_t));
	if(idle == NULL){
		printf("No memory for idle thread\n");
		return;
	}

	idle->directory = &kernel_directory_struct;
	idle->saved_registers.esp = idle_stack + 1023;
	idle->saved_registers.eip = halt;

	idle->status = THREAD_STATUS_READY;
	idle->pid = get_next_pid();
	idle->saved_registers.privl = 0;
	idle->were_registers_saved = 0;
	printf(", idle: %d\n", idle->pid);
	int res = init_multitasking(idle);

	queue_thread(t1);
	// printf("kernel_directory: %x\n", kernel_directory_struct.directory_addr);
	init_pit();
	thread_start(idle);
};